<div class="entities" style="line-height: 2.5; direction: ltr">Comparative effects of azimilide and ambasilide on the human ether-a-go-go-related gene ( Q12809 ) potassium channel . OBJECTIVE : To evaluate the effects of azimilide and ambasilide on the biophysical properties of the human-ether-a-go-go-related ( Q12809 ) channel . METHODS : Q12809 was stably transfected into Chinese hamster ovary ( CHO -

 ) cells and currents were measured using a whole cell , voltage-clamp technique . RESULTS : 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB04957

 had a ' dual effect ' , inhibiting current at voltage steps above - 40 mV and augmenting current at - 40 and - 50 mV . Tail current inhibition following a step to + 30 mV did not vary with temperature ( IC ( 50 ) 610 nM at 22 degrees C and 560 nM at 37 degrees C ) . The agonist effect at - 50 mV was concentration-dependent and correlated with a hyperpolarizing shift in the V ( 1/2 ) of activation ( r = 0.98 , P &lt; 0.05 ) . Time constants of inactivation were faster and there was a - 10 mV shift in the V ( 1/2 ) of steady state inactivation suggestive of open and inactivated state binding . By comparison , ambasilide inhibited Q12809 channels with lower potency ( IC ( 50 ) 3.6 microM ) , in a voltage - and time-dependent but frequency-independent manner ( 0.03- 1 Hz ) . Ambasilide had no effect on activation or inactivation gating but prolonged both fast and slow components of deactivation consistent with unbinding from the open state . The net effect of both drugs was similar during a voltage ramp which simulated a cardiac action potential . CONCLUSIONS : Inhibition of Q12809 channels by azimilide and ambasilide exhibits a similar time and voltage-dependence . While both exhibit affinity for the open state , azimilide also binds to inactivated channels .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Treatment of peripapillary choroidal neovascularization with intravitreal bevacizumab . PURPOSE : Peripapillary choroidal neovascularization ( CNV ) is an uncommon condition and often shows a growth tendency towards the fovea during spontaneous progression that threatens visual acuity . Treatment of peripapillary CNV is difficult . The authors report results of intravitreal bevacizumab therapy for peripapillary CNV . METHODS : Four patients with CNV located in the temporal or superior peripapillary area received intravitreal bevacizumab injections . Ophthalmologic examinations including

 were performed at baseline and at 6 - week intervals . DB00693 angiography was performed at baseline and depending on clinical and

 findings . The mean follow-up was 34 + / - 20 ( 22-69 ) weeks . RESULTS : The patients received an average of 3.5+ / -3.1 ( 1-8 ) injections . In all patients fluorescein angiography showed inactivation of peripapillary CNV . No further increase in size was observed in any of the patients . The 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<div class="entities" style="line-height: 2.5; direction: ltr">Vitamin D analogues . The plethora of actions attributed to 1,25 ( OH ) 2D3 throughout the body have suggested potential therapeutic applications for the treatment of hyperproliferative diseases , immune dysfunction , endocrine disorders , and metabolic bone disease . However , the potent calcemic activity of the natural vitamin D hormone has precluded its use in most cases . New vitamin D analogues are under development that display greater specificity , in most cases , by retaining the therapeutic properties of 1,25 ( OH ) 2D3 , but with lower calcemic activity . Two analogues have been approved for use in patients : calcipotriol ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 from Leo Pharmaceuticals , Copenhagen , Denmark ) for the treatment of psoriasis ; and 19 - nor -1,25 ( OH ) 2D2 ( DB00910 from Abbott Laboratories , Abbott Park , IL ) for secondary hyperparathyroidism . Many others analogues are currently being tested in preclinical and clinical trials for the treatment of various types of cancer and osteoporosis , and for immunosuppression . The selectivity of the analogues can be attributed to the combined interactions with four proteins : the vitamin D receptor (

 ) , the serum vitamin D binding protein ( DBP ) , the vitamin D - 24 - hydroxylase and to a newly described membrane receptor . Low DBP affinity has been shown to be responsible for the reduced calcemic actions of calcipotriol and 22 - oxacalcitriol ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ) , which is being tested for secondary hyperparathyroidism . However , the low calcemic activity of other analogues , including 19 - nor -1,25 ( OH ) 2D2 , involves other , as yet undefined , mechanisms . Understanding of the molecular basis for the selectivity of the vitamin D analogues will allow the design of more effective and safer vitamin D compounds for the treatment of a wide range of clinical disorders .</div>
